import 'dart:convert';import 'package:json_annotation/json_annotation.dart';part 'token_model.g.dart';@JsonSerializable()class TokenModel {  const TokenModel({    this.refreshToken,    this.accessToken,  });  @JsonKey(name: 'refresh_token')  final String? refreshToken;  @JsonKey(name: 'access_token')  final String? accessToken;  factory TokenModel.fromJson(Map<String, dynamic> json) => _$TokenModelFromJson(json);  Map<String, dynamic> toJson() => _$TokenModelToJson(this);  String serialize() => json.encode(toJson());  static TokenModel deserialize(String source) => TokenModel.fromJson(json.decode(source));}